const app=new Vue({data:()=>({load:!1,config:"",view:!1}),methods:{openItem:function(t,e){this.view=e.toString(),console.log(t,e)}},beforeCreate(){axios.get("config.json").then(t=>{this.config=JSON.parse(JSON.stringify(t.data))}).then(()=>{document.title=this.config.site.title,$('meta[name="description"]').attr("content",this.config.site.desc),$('link[rel="shortcut icon"]').attr("href",this.config.site.favicon),this.load=!0})}}).$mount("#app");